import React from 'react';
import { Col, Row } from 'react-bootstrap';
import Footer from './Footer';
import Presentation from './Presentation';

const Admin = () => {
    return (
        <div>
            <Presentation/>
                <Row>
                    <Col sm={2} className="AjoutVoitureDiv">    
                  <a className="ajouterVoiture"> Ajouter une nouvelle Voiture </a>
                    </Col>
                    <Col>
                     <a className="ajouterVoiture"> Actualiser la Page </a>
                    </Col>
                </Row>
            <Footer/>
        </div>
    );
};

export default Admin;
